type Data struct {
	val    []string
	valMap map[string]bool
}

func NewData(values []string) *Data {
	tmpMap := map[string]bool{}
	for _, value := range values {
		tmpMap[value] = true
	}
	return &Data{
		val:    values,
		valMap: tmpMap,
	}
}

func (d *Data) findArray(k string) bool {
	for _, value := range d.val {
		if value == k {
			return true
		}
	}
	return false
}

func (d *Data) findMap(k string) bool {
	return d.valMap[k]
}
